適合車種　トヨタ　ハイゼット<BR>適合型式　S100C S100CT<BR>純正品番　28100-87536<style>

p,ul,li,h1,h2,h3,h4,h5,h6,a,img{
	margin:0;
	padding:0;
	text-decoration:none;
	list-style:none;
	font-weight:normal;
	border:none;
	}

.header{
　　width:970px;
　　text-align: center;
}

.menu{
	width:960px;
	text-align:center;
}

.menu ul{
	background-color:#FFFFFF;
	height:18px;
	float:left;
	}

.menu li{
	background-color:#FFFFFF;
	margin:0px 18px 0px;
	padding:3px 15px 3px 15px;
	font-size: 12px;
	float:left;
	color:#628dc4;
	}

.menu li a{
	font-size: 12px;
	color:#628dc4;
	}	

.search-header{
	width:970px;
	border:none;
	padding:0px;
	background-color:#FFFFFF;
	text-align:center;
	}

.search-header table{
	height:60px;
	margin:0px 0px 0px;
	padding:20px 0 0;
	background-color:#ecf4ff;
	border-collapse: collapse;
	}

.search-header input{
        margin-left:20px;
        }

a:hover{
	 text-decoration: underline;
	 font-weight:bold;
}

ul, ol, dl {
	padding: 0;
	margin: 0;
	list-style-type: none;
	padding-bottom:5px;
	}

.left_category {
	 font-size: 12px;
	 width: 180px;
         padding:0px 5px 0 5px;
	 background-color:#ecf4ff;

}

.left_category ul{
	 padding-bottom: 15px;
}

.left_category li{
	 padding: 2px;
}

.left_category li a{
	 color:#4c4c4c;
	 padding-left: 5px;

}

.left_category a{
	 text-decoration: none;
}

.ttl { font-size: 14px;
       color:#FFFFFF;
       background-color:#628dc4;
       font-weight:bold;
       padding: 5px 0 0 0;
       width:180px;
	   }

.ttl a{ color:#FFFFFF;
	   }

.ttl ul a:hover{ background-color:#f47272;
	   }

.ttl img{ vertical-align:middle;/*middleは中央揃え*/
          padding: 5px;
	   }

.footer{
	width:970px;
	}

.ttl_shopguide { font-size: 16px;
       color:#FFFFFF;
	   background-color:#628dc4;
       font-weight:bold;
	   padding:3px 15px 3px 15px;
       width:940px;
	   }

.tbl { border: 1px solid #888888;
       background-color:#ecf4ff;
　　　 width:970px;
	   }	

.tbl table{
	 font-size: 12px;
	 width:970px;}	   

.subttl_shopguide { font-size: 12px;
       color:#FFFFFF;
	   background-color:#628dc4;
       font-weight:bold;
	   padding:3px 15px 3px 15px;
	   width:50%;
	   }



.clear { 
    clear:both;　/*floatの解除*/ 

} 



</style>

